          <script> // #chat
          // window.onscroll = function() {console.log('chat load'); chatScroll()};
          var chatstate = false;
          function chatScroll() {
            if(10 <= document.documentElement.scrollTop && !chatstate ){
              chatstate = true;
              chat();
            }
          }
          function chat(){
            // console.log('chat load')
            window.intercomSettings = {
              app_id: "kcqsc3al"
            };
            var d=document;
            var s=d.createElement('script');s.type='text/javascript';s.async=true;s.src='https://widget.intercom.io/widget/kcqsc3al';
            var x=d.getElementsByTagName('script')[0];x.parentNode.insertBefore(s,x);
          }
          </script>

          {% if number_whatsapp %}
          <!-- GetButton.io widget -->

          <script> // #pontes #lazy #lazyload #lazy load
          var whatsState = false;
          function whatsScroll() {
            if(10 <= document.documentElement.scrollTop && !whatsState ){
              whatsState = true;
              whats();
            }
          }
          function whats(){
            // console.log('whats load')
            var options = {
              whatsapp: "{{ number_whatsapp }}", // WhatsApp number
              greeting_message: "Olá, como podemos ajudá-lo?", // Text of greeting message
              call_to_action: "Fale Conosco!", // Call to action
              button_color: "#FF6550", // Color of button
              position: "left", // Position may be 'right' or 'left'
              ga: true, // Google Analytics enabled
              branding: true, // Show branding string
              mobile: true, // Mobile version enabled
              desktop: true, // Desktop version enabled
              greeting: false, // Greeting message enabled
              shift_vertical: 0, // Vertical position, px
              shift_horizontal: 0, // Horizontal position, px
              domain: "jacalculei.com.br", // site domain
              key: "J9LA9DYiRKW7XkIJfNO1_g", // pro-widget key
            };
            var proto = document.location.protocol, host = "getbutton.io", url = proto + "//static." + host;
            var s = document.createElement('script'); s.type = 'text/javascript'; s.async = true; s.src = url + '/widget-send-button/js/init.js';
            s.onload = function () { WhWidgetSendButton.init(host, proto, options); };
            var x = document.getElementsByTagName('script')[0]; x.parentNode.insertBefore(s, x);
          }

          </script>

          {% endif %}

          <script> // #font fontawesome
          // window.onscroll = function() {fontScroll()};
          var fontstate = false;
          function fontScroll() {
            if(10 <= document.documentElement.scrollTop && !fontstate ){
              fontstate = true;
              // console.log('font');
              var css = document.createElement('link');
              css.href = '//netdna.bootstrapcdn.com/font-awesome/4.7.0/css/font-awesome.min.css';
              css.rel = 'stylesheet';
              css.type = 'text/css';
              document.getElementsByTagName('head')[0].appendChild(css);
            }
          }
          </script>

